uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

// --- ASSETS ---
uniform sampler2D iChannel0; // Slot 0: Depth Map

// --- UNIFORMS ---
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_glow_intensity;

// --- GEOMETRY CONTROLS ---
uniform float u_depth_strength;
uniform float u_face_zoom;
uniform float u_face_offset_y;
uniform float u_precision;      // Step Speed (Lower = Better Quality)

// --- STYLE CONTROLS ---
uniform float u_smoothness;     // 0.001 (Sharp) to 0.02 (Smooth)
uniform float u_wireframe_mix;  // 0.0 (Solid) to 1.0 (Wireframe)

out vec4 fragColor;

// --- CONSTANTS ---
#define MAX_STEPS 256
#define MAX_DIST 50.0
#define SURF_DIST 0.0005

// --- MAPPING ---
float map(vec3 p) {
    // Defaults
    float pDepth = (abs(u_depth_strength) < 0.001) ? 1.2 : u_depth_strength;
    float pZoom  = (abs(u_face_zoom) < 0.001)      ? 1.0 : u_face_zoom;
    float pOffY  = (abs(u_face_offset_y) < 0.001)  ? 0.25 : u_face_offset_y;

    // 1. Base Shape: Box (Canvas)
    float d = length(max(abs(p) - vec3(1.0, 1.3, 0.05), 0.0)) - 0.01;

    // 2. Texture Mapping
    vec3 p_mapped = p;
    p_mapped.y -= pOffY;
    vec2 uv = p_mapped.xy * vec2(pZoom, pZoom * 0.75) + vec2(0.5, 0.5);

    // 3. Displacement
    if (uv.x > 0.0 && uv.x < 1.0 && uv.y > 0.0 && uv.y < 1.0) {
        float h = texture(iChannel0, uv).r;

        // --- CUTOUT LOGIC ---
        // If the pixel is black, we push it away (make invisible)
        // BUT we are gentle about it.
        if (h < 0.05) {
             d += 10.0; // Hide background
        } else {
             // Edge Fade
             float fade = smoothstep(0.0, 0.1, uv.x) * smoothstep(1.0, 0.9, uv.x) *
                          smoothstep(0.0, 0.1, uv.y) * smoothstep(1.0, 0.9, uv.y);

             // Displace
             d -= h * pDepth * fade;
        }
    } else {
        d += 10.0; // Hide outside bounds
    }

    return d;
}

// --- SMOOTH NORMALS ---
vec3 getNormal(vec3 p) {
    float d = map(p);

    // SMOOTHING: We use the slider to determine how "blurry" the normal check is
    float smoothVal = (u_smoothness < 0.0001) ? 0.002 : u_smoothness;
    vec2 e = vec2(smoothVal, 0.0);

    return normalize(vec3(d - map(p - e.xyy), d - map(p - e.yxy), d - map(p - e.yyx)));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // Camera
    float camDist = max(u_camera_dist, 3.5);
    vec3 ro = vec3(sin(iTime * 0.5) * 1.5, 0.0, camDist);
    vec3 ta = vec3(0.0, 0.0, 0.0);
    vec3 rd = normalize(normalize(ta - ro) * max(u_fov, 0.8) + uv.x * normalize(cross(vec3(0,1,0), normalize(ta-ro))) + uv.y * cross(normalize(ta-ro), normalize(cross(vec3(0,1,0), normalize(ta-ro)))));

    // Raymarch
    float t = 0.0;
    float d = 0.0;
    bool hit = false;
    float stepSpeed = (u_precision < 0.01) ? 0.2 : u_precision;

    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * t;
        d = map(p);
        if(d < SURF_DIST) { hit = true; break; }
        if(t > MAX_DIST) break;
        t += d * stepSpeed; 
    }

    vec3 col = vec3(0.0);

    if(hit) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);
        vec3 ref = reflect(rd, n);

        // Re-sample height
        float pZoom = (abs(u_face_zoom) < 0.001) ? 1.0 : u_face_zoom;
        float pOffY = (abs(u_face_offset_y) < 0.001) ? 0.25 : u_face_offset_y;
        vec3 p_mapped = p; 
        p_mapped.y -= pOffY;
        vec2 mapUV = p_mapped.xy * vec2(pZoom, pZoom * 0.75) + vec2(0.5, 0.5);
        float h = texture(iChannel0, mapUV).r;

        // --- STYLE 1: SOLID SKIN ---
        vec3 skinCol = vec3(0.05, 0.02, 0.02); // Dark Red/Black Base
        vec3 lightCol = vec3(1.0, 0.9, 0.8);   // Pale Skin Highlight
        vec3 solid = mix(skinCol, lightCol, pow(h, 1.5)); // Contrast curve

        float diff = clamp(dot(n, vec3(0.0, 0.5, 1.0)), 0.0, 1.0);
        float spec = pow(max(dot(ref, vec3(0,0,1)), 0.0), 32.0);
        float rim = pow(1.0 + dot(rd, n), 4.0);

        solid = solid * diff + spec * 0.5 + rim * vec3(0.0, 0.5, 1.0) * 0.5;

        // --- STYLE 2: WIREFRAME ---
        float gridDensity = 40.0;
        float lineThick = 0.01;
        float gridX = smoothstep(lineThick, 0.0, abs(sin(p.x * gridDensity)));
        float gridY = smoothstep(lineThick, 0.0, abs(sin(p.y * gridDensity)));
        float wire = max(gridX, gridY);
        vec3 wireCol = vec3(0.0, 1.0, 1.0) * wire; // Cyan Wire

        // --- MIXER ---
        float mixVal = u_wireframe_mix;
        // Blend: 0.0 = Solid, 1.0 = Wireframe
        col = mix(solid, wireCol, mixVal);

        // Glow
        col += solid * u_glow_intensity * 0.2;

        // Backface Culling (Hide inside of mask)
        if(dot(n, rd) > 0.0) col = vec3(0.0);

    } else {
        // --- BACKGROUND GRID (SAFETY NET) ---
        // If you see this Blue Grid, the shader is working!
        // If the face is missing, it means the Texture is Black/Missing.
        float grid = step(0.98, max(abs(sin(uv.x * 10.0)), abs(sin(uv.y * 10.0))));
        col = vec3(0.0, 0.05, 0.1) * grid * 0.5;
    }

    col = pow(col, vec3(0.4545));
    fragColor = vec4(col, 1.0);
}
